import React from 'react';

function TransactionHistory({ transactions }) {
    return (
        <div>
            <h3>Transaction History:</h3>
            <ul>
                {transactions.map((transaction, index) => (
                    <li key={index}>{transaction.description}</li>
                ))}
            </ul>
        </div>
    );
}

export default TransactionHistory;
